/* Slideshow container */

.slideshow-container {
    position: absolute;
    min-width: 100%;
    height: 23%;
    bottom: 0.8%;
    background: var(--bg-black-900);
    overflow: hidden;
}

.mySlides {
    display: flex;
    position: relative;
    justify-content: center;
    align-items: center;
    min-width: 100%;
    height: 100%;
    transition: all .5s;
}

.mySlides::before,
.mySlides::after {
    position: absolute;
    content: "";
    width: 25px;
    height: 25px;
    z-index: 100;
    border: 4px solid var(--skin-color);
}

.mySlides::before {
    top: 2%;
    right: 2%;
    border-bottom-color: transparent;
    border-left-color: transparent;
}

.mySlides::after {
    bottom: 2%;
    left: 2%;
    width: 5%;
    border-top-color: transparent;
    border-right-color: transparent;
}


