.text {
    color: var(--text-black-900);
    font-size: 15px;
    padding: 5px 10px;
    position: absolute;
    bottom: 0;
    min-width: 40%;
    text-align: center;
    z-index: 100;
    font-weight: 900;
    -webkit-backdrop-filter: blur(3px);
    backdrop-filter: blur(3px);
    border-radius: .5rem;
}


